import React from 'react';

const initialData = [
  { id: 1, name: 'John Doe', phoneNumber: '1234567890', email: 'john@example.com', hoodieId: 'ABC123' },
  { id: 2, name: 'Jane Smith', phoneNumber: '9876543210', email: 'jane@example.com', hoodieId: 'XYZ789' }
];

class Table extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: initialData
    };
  }

  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Phone Number</th>
            <th>Email</th>
            <th>Hoodie ID</th>
          </tr>
        </thead>
        <tbody>
          {this.state.data.map(item => (
            <tr key={item.id}>
              <td>{item.name}</td>
              <td>{item.phoneNumber}</td>
              <td>{item.email}</td>
              <td>{item.hoodieId}</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}

export default Home;
